import React from 'react';
import { Stage, Layer, Rect, Text } from 'react-konva';

import { percentageOf } from '../../utilities';
import { A4_PAPER_WIDTH, A4_PAPER_HEIGHT } from '../../constants';

import './styles.css';

const percentageOfA4Width = percentageOf(A4_PAPER_WIDTH);
const percentageOfA4Height = percentageOf(A4_PAPER_HEIGHT);

function Individual341() {
  return (
    <Layer>
      <Rect
        x={98}
        y={95}
        width={912}
        height={680}
        stroke="black"
        strokeWidth={20}
      />
    </Layer>
  );
}

function Form341() {
  return (
    <Stage className="Form341" width={A4_PAPER_WIDTH} height={A4_PAPER_HEIGHT}>
      <Individual341 />
    </Stage>
  );
}

export default Form341;
